sys_variable_value.value:
(function execute(inputs, outputs) {
    var vpc = new GoogleVPCUtils();
    vpc.validateInputVariables(inputs, outputs);
    vpc.validateMandatoryVariables(inputs, ['name', 'projectid', 'region']);
    vpc.maptoOutputFromInput(inputs, outputs, ['projectid', 'region']);
    var requestBody = {
        'name': inputs.name.toLowerCase(),
        "addressType":"EXTERNAL"
    };
    if (inputs["description"])
        requestBody["description"] = inputs["description"];
    if (inputs["networktier"])
        requestBody["networkTier"] = inputs["networktier"];
    outputs.requestbody = JSON.stringify(requestBody);
})(inputs, outputs);

